  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Union Slough
  NWR outlines Refuge accomplishments from January through April of 1948. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, furbearers, raptors, and
  fish- is also covered. The Refuge development and maintenance section discusses
  physical developments and plantings. Resource management is outlined; topics include
  fur harvesting. The public relations section of the report describes recreational
  uses, Refuge visitors, Refuge participation, fishing, and violations. Items of interest,
  an annual summary of activities, photographs, and N-R forms are attached.\",\n\t\"owner_org\":
